    image: emailRocketImage
  }

  return (
    <div style = {{marginTop: 35}}> 
      <Introduction name = {name} description = {introduction}/>
      <ProjectEmaiilRocket info = {emailRocketProject}/>
    </div>
  );
}

export default App;
